import React from 'react';
import { Container, Button, Typography, Box } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();

    const handleCreateGame = () => {
        navigate('/creer-partie');
    };

    const handleJoinGame = () => {
        navigate('/rejoindre-partie');
    };

    return (
        <Container maxWidth="sm">
            <Box mt={8}>
                <Typography variant="h4" component="h1" gutterBottom>
                    Bienvenue dans Grimoires Guardians
                </Typography>
                <Box mt={4}>
                    <Button variant="contained" color="primary" fullWidth onClick={handleCreateGame}>
                        Cr√©er une Partie
                    </Button>
                </Box>
                <Box mt={2}>
                    <Button variant="contained" color="secondary" fullWidth onClick={handleJoinGame}>
                        Rejoindre une Partie
                    </Button>
                </Box>
            </Box>
        </Container>
    );
};

export default Home;
